import React from "react";
import ImgBtn from "./ImgBtn";

export default function Body({handleBody}) {
    const imgbtns = []
    for (let i = 1; i < 18; i++) {
        const url = `character/body/${i}.png`;
        imgbtns.push(<ImgBtn url={url} handleChange={() => handleBody(url)}/>); 
    }
    return (
        <div>
            <h3>BODY</h3>
            <div class="eachBody">
                <div>{imgbtns}</div>
            </div>
        </div>
    )
}
